import {BrowserRouter as Router , Route, Switch } from 'react-router-dom';
import PageAlbums from './components/pages/PageAlbums';

export default function Routes(){

    <Router>
        <Switch>
          <Route exact path="/albums" components={PageAlbums}></Route>
        </Switch>
    </Router>
  }
